DESCRIPTION:
Įrengiant papildomus komunalinių atliekų konteinerius:
* apgadintos esamo šaligatvio plytelės;
* apgadintas buvęs gerbuvis;
* gruntu užterštas esamas šaligatvis, įvažiavimas į kiemą;
Prašymas - baigus konteinerių įrengimo darbus pakeisti pažeistas plyteles naujomis bei atstatyti pažeistą gerbuvį. Imtis priemonių grunto nuo šaligatvio, įvažiavimo į kiemą pašalinimui.

Laba diena.
Noriu pasidžiaugti ir padėkoti, kad buvo suremontuotas Fabijoniškių g. 90, 92 ir 94 namų kiemas. 
Tačiau taip pat turiu priminti, kad iki remonto Kaimelio gatvėje (54.729437, 25.243953) buvo įrengtas greičio mažinimo kalnelis, kuris iki šiol dar neatstatytas.

Atsižvelgiant į tai, kad nepaisant to, kad Kaimelio gatvėje galioja gyvenamosios zonos režimas, tačiau transporto priemonės retai laikosi greičio apribojimo (ypač dabar, kai kelio danga be duobių), ir tai, kad tarp aukščiau minėtų namų vyksta tranzitinis judėjimas tarp Ateities ir Fabijoniškių gatvių, prašau, kaip galima greičiau imtis priemonių, kad būtų atstatytas greičio mažinimo kalnelis.
Taip pat prašau, siekiant užtikrinti pėsčiųjų, ypač vaikų, saugumą, be jau minėto buvusio greičio mažinimo kalnelio (54.729437, 25.243953) įrengti papildomus. Papildomi greičio mažinimo kalneliai turėtų būti įrengti: 
- 54.729502, 25.244741;
- 54.729638, 25.244266;
- 54.729239, 25.242936;
- 54.730063, 25.243017.

Iš anksto dėkoj
